import React, { useState } from 'react';
import './tiktak.css';

function Board() {
  const status = "next player: X";
  const [gameState, setGameState] = Array(9).fill(null);
  return (
    <div>
      <div className="status">{status}</div>
      <div class="board-row">
        <Square num={0} />
        <Square num={1} />
        <Square num={2} />
      </div>
      <div class="board-row">
        <Square num={3} />
        <Square num={4} />
        <Square num={5} />
      </div>
      <div class="board-row">
        <Square num={6} />
        <Square num={7} />
        <Square num={8} />
      </div>
    </div>
  );

}
function Square(props) {
  const [displayed, setDisplyed] = useState("");
  return (
    <button class="square" onClick={() => setDisplyed("X")}>{displayed}</button>
  );

}
function Tiktak() {

  return (
    <div>
      <h2>Tiktak</h2>
      <div class="game-board">
        <Board />
      </div>
      <div class="game-info">
        <div>{}</div>
      </div>
    </div>
  )
}


export default Tiktak;
